export default {
    name: 'BotaoFinalizar',
    props: {
        textoButton: {
            type: String,
            default: 'Finalizar'
        }
    },
    data() {
        return {
            loading: false
        }
    },
    methods: {
        async finalizar() {
            try {
                this.loading = true
                await this.$listeners.finalizar()
                this.loading = false
            } catch (e) {
                this.loading = false
            }
        }
    }
}
